   부트스트랩은 기기나 뷰포트 크기가 증가함에 따라 12 열이 적절하게 ','
    행은 반드시 적절한 정렬과 패딩을 위해서 .container (fixed-width) 나 .container-fluid (full-width) 안에 위치해야 합니다.
